sys_variable_value.value:
(function execute(inputs, outputs) {
   var notify = new sn_notify.NotifyScoped();
   var from = '+12253963290';
   var to = inputs["to"];
   new notify.sendSMS(from, to, 'Hi '+ inputs["Name"]+","+'\n'+ 'Your appointment is Waiting for Approval from the Doctor :  '+inputs["doctorName"]+'\n' + 'Date of Appointment Selected : '+ inputs["date"] + "\n"+'Time Slot Selected : ' + inputs["timeSlot"]);
})(inputs, outputs);

